package jspexp.a01_vo;
// jspexp.a01_vo.Puppy
public class Puppy {
	private String name;
	private int age;
	public Puppy() {
		// TODO Auto-generated constructor stub
	}
	public Puppy(String name, int age) {
		this.name = name;
		this.age = age;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getAge() {
		return age;
	}
	public void setAge(int age) {
		this.age = age;
	}
	
}
